// SPDX-License-Identifier: UNLICENSED 
pragma solidity ^0.8.0;

contract VolcanoCoin {
    uint256 public TOTAL_SUPPLY = 10000;
    address public owner;
    event totalSupplyChanged(string, uint256);
    uint256 balances;

    constructor() {
        owner = msg.sender;
        balancePerAddress[owner];
    }

    modifier onlyOwner {
        if (msg.sender == owner) {
            _;
        }
    }

    function increaseTotalSupply() public onlyOwner {
        TOTAL_SUPPLY += 1000;
        emit totalSupplyChanged("New Total Supply = " , TOTAL_SUPPLY);
    }

    mapping(address => uint) balancePerAddress;

    function getUserBalance(address user) public view returns(uint) {
        return balancePerAddress[user];
    }
}

